import logo from "./logo.svg";
import "./App.css";

function App() {
  async function stuff() {
    const url = 'https://chicken-facts.p.rapidapi.com/facts/order/id/asc/page/1.json';
    const options = {
      method: 'GET',
      headers: {
        'X-RapidAPI-Key': '1fece9cd46msh18f98aab476cdbfp1ac901jsnd793ec542456',
        'X-RapidAPI-Host': 'chicken-facts.p.rapidapi.com'
      }
    };

    try {
      const response = await fetch(url, options);
      const result = await response.text();
      console.log(result);
    } catch (error) {
      console.error(error);
    }
  }
  stuff();

  return <div className="App">hi</div>;
}

export default App;
